--this produces the prednosone/methyprednisolone oral concept set

SELECT
  --csm.codeset
  c.concept_id
  ,c.concept_name
  ,c.standard_concept
  ,'' as standard_concept_caption
  ,c.invalid_reason
  ,'' as invalid_reason_caption
  ,c.concept_code
  ,c.domain_id
  ,c.vocabulary_id
  ,c.concept_class_id
FROM  v6.concept c
WHERE 
  domain_id = 'drug'
  and
  vocabulary_id != 'RXNorm Extension'
  and 
  standard_concept =  'S'
  and 
  (
    concept_name like '%prednisone%' 
    or 
    concept_name like '%methylprednisolone%'
   )

--this produces the prednisolone  concept set

   
